/* http://meyerweb.com/eric/tools/css/reset/
   v2.0 | 20110126
   License: none (public domain)
*/
@import url("https://fonts.googleapis.com/css?family=Playfair+Display");
@import url("https://fonts.googleapis.com/css?family=Roboto");
html, body, div, span, applet, object, iframe, h1, h2, h3, h4, h5, h6, p, blockquote, pre, a, abbr, acronym, address, big, cite, code, del, dfn, em, img, ins, kbd, q, s, samp, small, strike, strong, sub, sup, tt, var, b, u, i, center, dl, dt, dd, ol, ul, li, fieldset, form, label, legend, table, caption, tbody, tfoot, thead, tr, th, td, article, aside, canvas, details, embed, figure, figcaption, footer, header, hgroup, menu, nav, output, ruby, section, summary, time, mark, audio, video {
  margin: 0;
  padding: 0;
  border: 0;
  font-size: 100%;
  font: inherit;
  vertical-align: baseline; }

/* HTML5 display-role reset for older browsers */
article, aside, details, figcaption, figure, footer, header, hgroup, menu, nav, section {
  display: block; }

body {
  line-height: 1; }

ol, ul {
  list-style: none; }

blockquote, q {
  quotes: none; }

blockquote:before, blockquote:after {
  content: '';
  content: none; }

q:before, q:after {
  content: '';
  content: none; }

table {
  border-collapse: collapse;
  border-spacing: 0; }

.imgBackground {
  position: fixed;
  width: 450px;
  height: 100vh; }

.header {
  position: relative;
  padding: 50px 80px 0 80px; }
  .header h1:first-child {
    color: #FFFFFF; }
  .header h1:last-child {
    color: #000000; }
  .header-container {
    display: flex;
    align-items: center;
    font-family: 'Roboto', sans-serif;
    text-transform: uppercase;
    font-weight: 200;
    font-size: 17px; }
    .header-container-title {
      display: flex;
      margin-left: 40px; }
    .header-container-text {
      padding-left: 100px; }
    .header-container-account {
      color: red;
      position: absolute;
      right: 0;
      margin-right: 80px; }
    .header-container-logo {
      width: auto;
      height: 10%; }

.section {
  display: grid;
  grid-template-columns: repeat(12, 1fr);
  grid-template-rows: repeat(6, 100px);
  font-family: 'Roboto', sans-serif; }
  .section-container-paragraph {
    grid-row: 3/5;
    grid-column: 2/6;
    z-index: 4;
    padding: 0 20px; }
    .section-container-paragraph-text {
      color: #ffffff;
      font-size: 30px;
      line-height: 2;
      font-weight: 100;
      letter-spacing: .2em; }
  .section-container-picture {
    grid-row: 1/7;
    grid-column: 4/8;
    background: url("uibpm.885ae112.jpg") no-repeat center;
    background-size: cover;
    z-index: 3;
    opacity: 1; }
  .section-container-picture2 {
    background: url("Texture02.02191db0.png") no-repeat;
    background-size: contain;
    grid-column: 7/12;
    grid-row: 2/6;
    padding-top: 100px;
    padding-left: 100px; }
    .section-container-picture2-text {
      font-size: 20px;
      line-height: 1.5;
      font-weight: 300;
      padding: 0 70px;
      margin-top: 20px;
      text-align: center; }
    .section-container-picture2-button {
      margin-top: 10%;
      margin-left: 35%;
      width: 145px;
      height: 50px;
      background-color: #000000;
      text-align: center;
      padding-top: 18px; }
    .section-container-picture2-item {
      color: #ffffff;
      font-size: 14px;
      font-weight: lighter;
      text-decoration: none; }

* {
  box-sizing: border-box; }

html {
  width: 100%;
  font-size: 62.5%; }
